  input: TEXT,F3XA,,"There was no Federal Election Acitivity for the month of November.
    The Party's focus was on state and local activities, with special attention having
    been paid to the gubernatorial recall election.                                                                                          During
    November, disbursements were made to  Jerry Mailhott, Jean Gallant and the La
    Jolla Group for voter registration activity. These payments were accrued expenses,
    orginally incurred in September 2003, which does not fall within the 120 day FEA
    window. These three accrued expenses do not constitute FEA.                    There
    was NOT an overtransfer as a result of the payroll and payroll tax items shifted
    from line 21a to 21b in this amendment. There is still ample room between total
    non-federal share of activity and what was actually transferred from the non-federal
    account in November. "
